import React from 'react'

function ToyContainer({ toys, onDeleteToy, onUpdateToy }) {
    const toyCards = toys.map((toy) => (
      <ToyCard
        key={toy.id}
        toy={toy}
        onDeleteToy={onDeleteToy}
        onUpdateToy={onUpdateToy}
      />
    ));

    return <div id="toy-collection">{toyCards}</div>;
  }


